다음 중국어 텍스트를 기반으로 한국인 학습자를 위한 퀴즈를 생성해 줘.

# 규칙:
1.  문제는 반드시 한국어로, 답과 보기는 반드시 중국어로 작성해 줘.
2.  전체 결과는 다른 설명 없이 반드시 하나의 JSON 객체 형식으로만 출력해야 해. **```json...```  절대 금지**
3.  JSON 객체는 'questions'와 'answers' 두 개의 최상위 키를 가져야 해.
4.  'questions' 키의 값은 문제 객체들의 배열이어야 해.
5.  'answers' 키의 값은 정답 객체들의 배열이어야 해.
6.  문제는 아래 종류와 개수를 정확히 지켜서 생성해야 해.
    -   객관식 (multiple-choice): 15개
    -   단답형 (short-answer): 3개
    -   따라 말하기 (repeat-after-me): 1개
    -   생각 말하기 (speak-your-thoughts): 1개

# JSON 형식:
{
  "questions": [
    {
      "type": "multiple-choice",
      "question_text_korean": "문제 내용(한국어)",
      "options_chinese": ["보기1(중국어)", "보기2(중국어)", "보기3(중국어)", "보기4(중국어)"]
    },
    // ... (다른 문제들)
  ],
  "answers": [
    {
      "question_text_korean": "문제 내용(한국어)",
      "correct_answer_chinese": "정답(중국어)"
    },
    // ... (다른 정답들)
  ]
}

# 중국어 텍스트:
{{14.`1`}}
